import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { WebRtcComponent } from './web-rtc/web-rtc.component';
import { JaasComponent } from './jaas/jaas.component';
import { JitsiComponent } from './jitsi/jitsi.component';

const routes: Routes = [
  { path: 'web-rtc', component: WebRtcComponent },
  { path: 'jaas', component: JaasComponent }
  { path: 'jitsi', component: JitsiComponent }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
